interface IProps extends IBaseProps {
  rowIndex: number;
  width: number;
  onNucleusAnimating: (animating: boolean) => void;
}
interface IState {
  previousChromosomeState: ChromosomeState;
  hoveredChromosome?: ChromIdType;
}

let timer: number;
const animationTime = 3000;

@inject("stores")
@observer
export class NucleusView extends BaseComponent<IProps, IState> {

  public state: IState = {
    previousChromosomeState: "expanded" as ChromosomeState
  };

  private disposer: IDisposer;

  private uniqueDomKey = `nucleus-view-${Math.random()}`;

  constructor(props: IProps) {
    super(props);

    this.state = {
      previousChromosomeState: this.chromosomeState
    };
  }

  public componentWillMount() {
    this.disposer = onAction(this.stores.organisms, this.updatingModel);
  }

  public componentWillUnmount() {
    if (this.disposer) this.disposer();
    if (timer) (window as any).clearTimeout(timer);
  }

  public render() {
    const { width } = this.props;
    const { hoveredChromosome } = this.state;
    const { selectedChromosome, organismsMouse } = this.row;
    const sex = organismsMouse!.backpackMouse.sex;
    const sexChromosome = sex === "male" ? "y" : "x2";

    const nucleusStyle: React.CSSProperties = {
      backgroundImage: "linear-gradient(#53B4AF, #3f9a95)"
    };
    if (width) {
      nucleusStyle.width = `${width}px`;
    }

    // we want element to completely re-render to reset elements "presentation time", which the
    //  animation's "dur" attribute is based on.
    const randKey = "svg" + Math.random();

    return (
      <div className="organism-view-container">
        <div className="organism-view" style={nucleusStyle} data-test="nucleus-view">
          <svg key={randKey} id="Chromatin_Paths" data-name="Chromatin Paths" viewBox="0 0 394 182"
              xmlns="http://www.w3.org/2000/svg" onMouseLeave={this.unsetHoveredChromosome}>
            {
              hoveredChromosome &&
              this.getChromosomeOutline(hoveredChromosome, false)
            }
            {
              selectedChromosome &&
              this.getChromosomeOutline(selectedChromosome, true)
            }
            {[
              this.getChromososome("c2a"),
              this.getChromososome("c2b"),
              this.getChromososome("c8a"),
              this.getChromososome("c8b"),
              this.getChromososome("x1"),
              this.getChromososome(sexChromosome),
            ]}
          </svg>
        </div>
      </div>
    );
  }

  // Setting the `previousChromosomeState` is what actually triggers an animation to occur
  // The `onNucleusAnimating` call just disables the menu buttons
  private startAnimation = () => {
    this.props.onNucleusAnimating(true);
    timer = (window as any).setTimeout(() => {
      this.setState({previousChromosomeState: this.chromosomeState});
      this.props.onNucleusAnimating(false);
    }, animationTime);
  }

  private updatingModel = (action: ISerializedActionCall) => {
    const { rowIndex } = this.props;
    this.unsetHoveredChromosome();
    if ((action.name === "toggleNucleusCondense" || action.name === "toggleNucleusPair")
        && action.path === `/rows/${rowIndex}`) {
      this.startAnimation();
    }
  }

  private getChromososome = (chromId: ChromIdType) => {
    const mouseChomId = this.mouseId + chromId;
    const coloredState = this.row.nucleusColored ? "colored" : "decolored";

    let color;

    if (coloredState === "decolored") {
      color = "#ffbf25";
    } else if (chromId.indexOf("c2") > -1) {
      color = "#19d119";
    } else if (chromId.indexOf("c8") > -1) {
      color = "#ba37e0";
    } else {
      color = "#dbdb22";
    }

    const chromosomeStyle = {
      fill: "none",
      stroke: color,
      strokeMiterlimit: 10,
      strokeWidth: "1.5px"
    };

    const chromosomeDef = Chromosomes[this.chromosomeState];

    if (this.chromosomeState !== this.state.previousChromosomeState) {
      const previousChromosomeDef = Chromosomes[this.state.previousChromosomeState];
      return (
        <React.Fragment>
          <path id={this.uniqueDomKey + mouseChomId} data-name={chromId} d={previousChromosomeDef[chromId]} style={chromosomeStyle}/>
          <animate xlinkHref={"#" + this.uniqueDomKey + mouseChomId} attributeName="d" attributeType="XML"
            from={previousChromosomeDef[chromId]}
            to={chromosomeDef[chromId]}
            dur={(animationTime / 1000) + "s"} fill="freeze" />
        </React.Fragment>
      );
    } else {
      return <path id={this.uniqueDomKey + mouseChomId} data-name={chromId} d={chromosomeDef[chromId]}
        style={chromosomeStyle} onMouseEnter={this.setHoveredChromosome(chromId)}
        onClick={this.setActiveChromosome(chromId)} />;
    }
  }

  private getChromosomeOutline = (chromId: ChromIdType, selected: boolean) => {
    const mouseOutlineId = this.mouseId + chromId + "Outline";
    if (this.chromosomeState === "expanded") return;
    const outlineStyle = {
      fill: "#ffa56dC0",
      stroke: "none"
    };

    const outlineState = this.chromosomeState + "Outline" as OutlineState;
    const outlineDef = Chromosomes[outlineState];

    if (this.state.previousChromosomeState !== "expanded" &&
        this.chromosomeState !== this.state.previousChromosomeState) {
      const previousOutlineState = this.state.previousChromosomeState + "Outline" as OutlineState;
      const previousOutlineDef = Chromosomes[previousOutlineState];
      return (
        <React.Fragment key={mouseOutlineId + chromId + (selected ? "Selected" : "")}>
          <path id={mouseOutlineId} data-name={chromId} d={previousOutlineDef[chromId]} style={outlineStyle}/>
          <animate xlinkHref={"#" + mouseOutlineId} attributeName="d" attributeType="XML"
            from={previousOutlineDef[chromId]}
            to={outlineDef[chromId]}
            dur={(animationTime / 1000) + "s"} />
        </React.Fragment>
      );
    } else {
      return <path key={mouseOutlineId + chromId + (selected ? "Selected" : "")} data-name={chromId + "-outline"}
        d={outlineDef[chromId]}
        style={outlineStyle} onMouseOut={this.unsetHoveredChromosome}
        onClick={this.setActiveChromosome(chromId)} />;
    }
  }

  private setHoveredChromosome = (name: ChromIdType) => () => {
    const isAnimating = this.chromosomeState !== this.state.previousChromosomeState;
    if (this.row.mode === "inspect" && !isAnimating) {
      this.setState({hoveredChromosome: name});
    }
  }

  private unsetHoveredChromosome = () => {
    const isAnimating = this.chromosomeState !== this.state.previousChromosomeState;
    if (!isAnimating) {
      this.setState({hoveredChromosome: undefined});
    }
  }

  private setActiveChromosome = (name: ChromIdType) => () => {
    if (this.row.mode === "inspect") {
      this.row.setSelectedChromosome(name);
    }
  }

  get row() {
    const { organisms } = this.stores;
    const { rowIndex } = this.props;
    return organisms.rows[rowIndex];
  }

  get mouseId() {
    return this.row.organismsMouse!.backpackMouse.id;
  }

  get chromosomeState(): ChromosomeState {
    return this.row.nucleusState;
  }
}
